🩷I am so honored to be invited to perform at Making Strides Against Breast Cancer of Greater Pittsburgh walk on Saturday, October 21st, 2023 at Acrisure Stadium and Pittsburgh's North Shore. I will be singing a special song for them in addition to the National Anthem! ➡️SWIPE to see when I performed this event 7 years ago!

This event is to help end breast cancer as we know it, for everyone! Making Strides Against Breast Cancer is hosted by the American Cancer Society and is the nation's non-profit leader in the fight against breast cancer! The activities begin starting at 8:00 AM and the walk begins at 10:30 AM. To learn more, start a team or sign-up, or if you have questions, please visit 
@pittsburghstrides 
