💕So honored to be a part of the Making Strides Against Breast Cancer Walk event! I sang the National Anthem then later for the kickoff I performed Fight Song. I have been trained to always be prepared for last minute changes. This event allowed me to practice that moto! I was to sing on a stage inside the stadium but due to a delay we had to move outside where the walkers were lined up and I sang Fight Song a capella. ➡️swipe for video! Everyone from the staff to volunteers to walkers were all so amazing! Thank you to everyone that donated! So many blessings in one place this weekend! 💕
